import React from "react";
import "../styles/Fun.css";
import { Link } from "react-router-dom";
import MilkBackground from "../assets/milk_hd.jpeg";
import FAQBackground from "../assets/background.jpg";
import Outline from "../assets/AI_head.jpeg";

function Fun() {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-4">
          <Link
            to="/milk"
            className="fun_slot"
            style={{ backgroundImage: `url(${MilkBackground})` }}
          >
            <div>Shaun</div>
          </Link>
        </div>
        <div className="col-md-4">
          <Link
            to="/FAQ"
            className="fun_slot"
            style={{ backgroundImage: `url(${FAQBackground})`, fontFamily: "fantasy" }}
          >
            FAQ
          </Link>
        </div>
        <div className="col-md-4">
          <Link
            to="/Sol"
            className="fun_slot"
            style={{ backgroundImage: `url(${Outline})`, fontFamily: "cursive", fontSize: "3rem" }}
          >
            Who Am I
          </Link>
        </div>
      </div>
    </div>
  );
}

export default Fun;
